import React, { Component } from "react";

export default class Cart extends Component {
  render() {
    return (
      <div>
        <div className='row'>
            <div className='col-md-12 '>
                <p className='display-4'>My Food Bag</p>
            </div>
        </div>
      </div>
    );
  }
}
